package practice.java;

public class ReverseMultiplicationTable {

	public static void main(String[] args) {
		
		// TODO Auto-generated method stub
		//table of 19 in reverse order
		int n=19;
		for(int i=10;i>=1;i--) {
			System.out.printf("%d X %d= %d\n",n,i,n*i);
		}
		
	}
	

}
 